import { Col, Container, Row } from "react-bootstrap";
import imgFlyer from "../assets/img/flyeralpha.png";

export const Company = () => {
    return(
        <section className="company" id="profile">
            <Container>
                <h1>Alpha Media</h1>
                <p>Alpha Media adalah perusahaan pemasaran digital yang mengutamakan platform TikTok, menggunakan kecerdasan buatan atau Artificial Intelligence (AI) sebagai landasan utama. Dengan fokus pada transformasi digital UMKM di Indonesia, terutama di bidang FnB dan kosmetik, Alpha Media mampu melakukan analisis pasar yang mendalam, mengidentifikasi audiens target, dan menciptakan konten relevan secara efisien.</p>

                <div style={{ position: 'relative' }}>
                        <img 
                            src={imgFlyer} 
                            alt="Description" 
                            style={{ 
                            position: 'center', 
                            top: '200px',
                            width: '40%',
                            transform: 'translate(-50%, -50%)' 
                            }} 
                        />
                </div>
            </Container>
        </section>
    )
}
